import React from "react";
import { Component } from "react";
import {BrowserRouter, Routes, Route } from "react-router-dom";
import Producto from './componentes/Producto';
import Cliente from './componentes/Cliente';
import Venta from './componentes/Venta';
import Reporte from './componentes/Reporte';
import Consolidacion from './componentes/Consolidacion';


class Router extends Component {
    render() {
        return(
            <BrowserRouter>
                <Routes>
                    <Route path="/producto" element = {<Producto />}/>
                    <Route path="/cliente" element = {<Producto />}/>
                    <Route path="/venta" element = {<Producto />}/>
                    <Route path="/reporte" element = {<Producto />}/>
                    <Route path="/consolidacion" element = {<Producto />}/>
                </Routes>
            </BrowserRouter>
        );
    }
}

export default Router;
